import React, { Component } from "react";
import FormField from "./formField";

class Form extends Component {
  state = {
    formFields: [
      { id: 1, value: 0 },
      { id: 2, value: 0 },
      { id: 3, value: 0 },
      { id: 4, value: 0 },
    ],
  };
  render() {
    return (
      <div>
        <FormField />
        <FormField />
        <FormField />
        <FormField />
      </div>
    );
  }
}

export default Form;
